Wagon＆One boxに重要な中低速でのトルクとクイックなレスポンスを実現し、スタイルにもこだわったスタンダードモデル。インナーサイレンサー無しの小容量砲弾型マフラーでありながらJASMA基準内の音量を保ちつつ、性能を犠牲にすることなく、中低速域におけるトルクとクイックレスポンスを同時に実現するという高機能マフラー。またエアロチューンを意識した遊び心満載のスタイルにこだわったデザインも魅力のひとつ。 <br>●材質：オールステンレス ●パイプ径（パイ）50 ●タイコ径（パイ）127 ●テール径（パイ）93 ●出口：S(左) ●リアピースのみ ●納期：お取り寄せ商品のため通常3～4日でのお届けとなります。(日・祝日は除く)万が一欠品の場合は別途メールにてご連絡差し上げます。お急ぎの場合はご注文前に必ず納期確認を頂きますようお願い申し上げます。<br>【注意事項】○12SR取付OK(バンパーとのクリアランス大)だが、保安基準適合外 ○M/C後、07/6～取付不可(バンパー形状が違う為、入り込み、切りかき位置にズレが生じます) <br>対応車種：02/5～07/6 BK12 マーチ 1.4L 2WD　エンジン型式：CR14DE <br>　保安基準適合品（JASMA認定）<br>排気系/マフラー<br>※送料は地域や配達場所によって変わりますが、6000円～12000円程度が目安となります。<tr><td colspan="2">
