120mm×80mmのオーバルテールは、厚すぎず薄すぎない絶妙なバランス。高級感あふれるエレガントさの中にもスポーティーさが見え隠れするスタイルは、カキモトレーシングならではの仕上がり。Ellisseテールは地上高の確保の面でも有利で非常に乗りやすいのが特徴です。また付属のロジウムコートされたグラマラスな厚みのロゴプレートには、オーストリアのスワロフスキー社製クリスタルが贅沢にセッティングされています。 <br>●材質：オールステンレス ●パイプ径（パイ）： 60 ●タイコ径（パイ）：- ●テール径（パイ）：120-80 ●出口：S(左) ●リアピースのみ ●クリスタルロゴプレート付属 ●クリスタルカラー：ブラックダイヤ<br>【注意事項】（1）インナーサイレンサー取付不可 （2）CBA-TU31(Vリミテッド) 音量オーバーの為、適合不可  【納期】お取り寄せ商品のため通常3～4日でのお届けとなります。(日・祝日は除く)万が一欠品の場合は別途メールにてご連絡差し上げます。 <br>対応車種：06/5～ CBA-PU31 プレサージュ ライダー3.5L (2WD) エンジン型式：VQ35DE <br>　保安基準適合品（JASMA認定）<br>排気系/マフラー<br>※送料は地域や配達場所によって変わりますが、6000円～12000円程度が目安となります。<tr><td colspan="2">
